import React from 'react';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Button from 'react-bootstrap/Button';

import blog1 from '../assets/images/blog1.jpg';
import blog2 from '../assets/images/blog2.jpg';
import blog3 from '../assets/images/blog3.jpg';
import blog4 from '../assets/images/blog4.jpg';
import blog5 from '../assets/images/blog5.jpg';
import blog6 from '../assets/images/blog6.jpg';

const images = [blog1, blog2, blog3, blog4, blog5, blog6];

function AppGrid() {
    return (
        <>
            <p style={{fontSize:'30px', alignItems:'center', marginTop:'50px', marginBottom:'20px', fontWeight: 'bold', textDecoration: 'underline', color: '#FF5733'}}>LATEST UPDATES</p>
        <Row xs={1} md={3} className="g-4">
            {images.map((image, idx) => (
                <Col key={idx}>
                    <Card style={{ alignItems:"center",marginLeft:'50px', width: '18rem' }}>
                        <Card.Img variant="top" src={image} />
                        <Card.Body>
                            <Card.Title>Card Title</Card.Title>
                            <Card.Text>
                                Some quick example text to build on the card title and make up the
                                bulk of the card's content.
                            </Card.Text>
                            <Button variant="primary">Go somewhere</Button>
                        </Card.Body>
                    </Card>
                </Col>
            ))}
        </Row>
        </>
    );
}

export default AppGrid;
